ôt oddelených čiarkami.','Season filters conditions.'=>'Podmienky sezónnych filtrov.','%sname%s – the unique name of the condition group, containing several conditions with different values. For example, if you want to have specific HTML content for the different week days, you can have several conditions, with the same name but with different value parameters in conditions. Please check more about it, in the examples.'=>'%snázov%s - unikátny názov skupiny podmienok, pozostávajúcej z niekoľkých podmienok s rôznou hodnotou. Napríklad, ak chceš mať špeciálny HTML obsah na rôzne dni v týždni, máš niekoľko podmienok s rovnakým názvom, ale s rôznymi parametrami hodnôt v podmienkach. Prejdi si to na príkladoch, prosím.','Season filter on the Season Filters page,'=>'Sezónny filter na strane Sezónne filtre','Season filter on the Season Filters page'=>'Filter sezón na stránke Filtre sezón','Please use  %sSingle day%s selection mode in the General Booking Settings page at calendar section.'=>'Použi, prosím, %sJeden deň%s spôsob výberu na strane Všeobecné nastavenia rezervácie v sekcii kalendára.','Please check more about this feature at  %sthis page%s'=>'Viac informácii o tejto funkcii nájdete na %stejto stránke%s','Time Field'=>'Pole čas','Enter the %sTime%s using the text field.'=>'Vstúp na %sČas%s a použi textové pole.','This field does not impact to availability (booking for the specific time) .'=>'Toto pole nemá vplyv na použiteľnosť (rezervovanie v špeciálnych prípadoch).','%stype%s – type of the condition. There are 2 types of condition: "weekday" and "season". "weekday" – is the condition rule based on the selected day of week value, like Monday, Tuesday, etc… . "season" – is the condition rule based on the "season filter" name of selected date. In other words the condition is TRUE if the selected day belongs to a season filter in the Season Filters page.'=>'%styp%s - typ podmienky. Sú dva typy podmienok:  "deň v týždni" a "sezóna". "deň v týždni" - je pravidlo podmie